import React from 'react'
import {Link, NavLink } from 'react-router-dom';


export default function Header()
{
    return(<>
<div className="  w-100">
<nav className="navbar navbar-expand-lg" 
    style={{ 
                backgroundColor:'#475562', 
                borderBottom:'0.5px white solid', 
                borderTop:'0.5px white solid' }}>
    
    <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNavAltMarkup" aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
      <span className="navbar-toggler-icon"></span>
    </button>
    <div className="collapse navbar-collapse justify-content-end" id="navbarNavAltMarkup">
      <div className="navbar-nav">
        <NavLink 
        activeStyle={{
                    borderBottom: "2px solid white",
                    color: "white"
                    }} className="nav-item nav-link text-white text-uppercase mx-2 active" to="/home">Home </NavLink>
        <NavLink activeClassName="bg-success" className="nav-item nav-link  text-white text-uppercase  " to="/about">About</NavLink>
        {/*<a className="nav-item nav-link  text-white text-uppercase mx-2 " href="#portfolios">Portfolios</a>*/}
        <NavLink activeClassName="bg-primary" className="nav-item nav-link text-white text-uppercase  " to="/services">Services</NavLink>
        {/*<a className="nav-item nav-link text-white text-uppercase mx-2 " href="#blog">Blog</a>*/}
        <NavLink  activeStyle={{
                    borderBottom: "2px solid white",
                    color: "white"
                    }} className="nav-item nav-link text-white text-uppercase  " to="/contact">Contact</NavLink>
           
           <NavLink  activeStyle={{
                    borderBottom: "2px solid white",
                    color: "white"
                    }} className="nav-item nav-link text-white text-uppercase  " to="/production">Production</NavLink>
           

           <NavLink  activeStyle={{
                    borderBottom: "2px solid white",
                    color: "white"
                    }} className="nav-item nav-link text-white text-uppercase  " to="/props">PropsObject</NavLink>
           
           <NavLink  activeStyle={{
                    borderBottom: "2px solid white",
                    color: "white"
                    }} className="nav-item nav-link text-white text-uppercase" to="/classes">ClassComponent</NavLink>

<NavLink  activeStyle={{
                    borderBottom: "2px solid white",
                    color: "white"
                    }} className="nav-item nav-link text-white text-uppercase" to="/classes">StateObject</NavLink>
           
		
      </div>
    </div>
  </nav>
  </div>

          </>)
}
